script: |
  super -f text -I q11702.spq | sort > q11702.out

inputs:
  - name: q11702.spq
    data: |
      SELECT DISTINCT - col1 AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE col0 NOT BETWEEN ( ( - - col0 ) + + col1 + + col2 / col1 * - col2 ) AND ( NULL );
  - name: tab2

outputs:
  - name: q11702.out
    data: |
      -51
      -67
      -77
